// React imports
import React, {
  useState,
  useEffect
} from 'react';

// Import CSS for the homepage
import './css/Home.css';

// State for the homepage message
function Home() {
  const [homeMessage, setHomeMessage] = useState(0);

  // Fetch the message from the API and update state
  useEffect(() => {
    fetch('/api/v1/home_message').then(res => res.json()).then(data => {
      setHomeMessage(data.message);
    });
  }, []);

  return (
    <div className="App">
      <header className="App-header">
        <img src={ aquaHeadshot } className="App-logo" alt="logo" />
        <p>{ homeMessage }</p>
        <a
          className="App-link"
          href="https://reactjs.org"
          target="_blank"
          rel="noopener noreferrer"
        >
          Learn React
        </a>
      </header>
    </div>
  );
}

export default Home;
